import { FC } from 'react';
import Button from '../components/button';
import Stack from '../components/stack';
import Grid from '../components/grid';
import Banner from '../components/banner';
import PFP from '../assets/logo/logo.png';
import Card from '../components/card';
import GenesisPFP from '../assets/pfp/genesis.png';

export const Home: FC<{}> = () => {

  return (
    <>

      <Stack direction='VERTICAL' localStyles={{marginTop: 0, marginBottom: 94, '@media (min-width: 1080px)': { marginBottom: 50,}}}>

        <Banner pfp={PFP} heading='Sheesh Coin' description='An ERC20 token prioritizing decentralization &amp; blockchain tech.'>
          <Button size='L' variant="PRIMARY" as="a" href='https://app.uniswap.org/#/tokens/ethereum/0xbb4f3ad7a2cf75d8effc4f6d7bd21d95f06165ca' target="_blank">Swap Now</Button>
        </Banner>

        <Grid columns={3}>
          <Card heading="Genesis" description='Collection Size • 7,777' pfp={GenesisPFP} direction="VERTICAL">
            <Button as="a" size='M' variant='SECONDARY' href='https://hub.auraexchange.org/collection/Ethereum/0x2d0d57d004f82e9f4471caa8b9f8b1965a814154' target="_blank">View Collection</Button>
            <Button as="a" size='M' variant="PRIMARY" href='/portals'>View Portals</Button>
          </Card>

          <Card heading="Genesis" description='Collection Size • 7,777' pfp={GenesisPFP} direction="VERTICAL">
            <Button as="a" size='M' variant='SECONDARY' href='https://hub.auraexchange.org/collection/Ethereum/0x2d0d57d004f82e9f4471caa8b9f8b1965a814154' target="_blank">View Collection</Button>
            <Button as="a" size='M' variant="PRIMARY" href='/portals'>View Portals</Button>
          </Card>

          <Card heading="Genesis" description='Collection Size • 7,777' pfp={GenesisPFP} direction="VERTICAL">
            <Button as="a" size='M' variant='SECONDARY' href='https://hub.auraexchange.org/collection/Ethereum/0x2d0d57d004f82e9f4471caa8b9f8b1965a814154' target="_blank">View Collection</Button>
            <Button as="a" size='M' variant="PRIMARY" href='/portals'>View Portals</Button>
          </Card>

        </Grid>

      </Stack>
    </>
  );
}

export default Home;
